import React, { Component } from 'react'
import Todo_Item from './Todo_Item'

export class Todo_list extends Component {
  render() {
    return (
      <div>
        {
            this.props.Todo.map(
                (todo) => {
                    Todo_Item 
                }
            )
        } 
      </div>
    )
  }
}

export default Todo_list
